async () => {
  const dates = ['2026-01-09', '2026-01-10'];
  const results = {};

  for (const date of dates) {
    try {
      const response = await fetch('https://spot.poweremarket.com/uptspot/ma/spot/spottrade/scptp/sr/mp/spottrade/baseinfo/TranOver/getWatchUserPriceData', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          operateDate: date,
          dateType: '1'
        })
      });

      const data = await response.json();
      results[date] = data;
    } catch (error) {
      results[date] = { error: error.message };
    }
  }

  return results;
}
